import React from 'react';
import Header from './components/Header';
import TransactionTable from './components/TransactionTable';
import AvailableBalances from './components/AvailableBalances';
import RevenueSources from './components/RevenueSources';
import { Tabs, TabsList, TabsTrigger, TabsContent } from '@ark-ui/react/tabs';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="tabs-container">
        <Tabs.Root defaultValue="transactions">
          <Tabs.List className="tabs-list">
            <Tabs.Trigger value="transactions">Transacciones</Tabs.Trigger>
            <Tabs.Trigger value="balances">Saldos Disponibles</Tabs.Trigger>
            <Tabs.Trigger value="revenueSources">Fuentes de Ingresos</Tabs.Trigger>
          </Tabs.List>

          <div className="tabs-content-wrapper">
            <TabsContent value="transactions">
              <TransactionTable />
            </TabsContent>
            <TabsContent value="balances">
              <AvailableBalances />
            </TabsContent>
            <TabsContent value="revenueSources">
              <RevenueSources />
            </TabsContent>
          </div>
        </Tabs.Root>
      </div>
    </div>
  );
}

export default App;
